import { Container } from "@mui/material";
import { Images } from "../../Constants/images";
const SeeBooking = () => {
  return (
    <div
      style={{
        backgroundImage: `url(${Images.BG3})`,
        backgroundSize: "cover",
        height: "100vh",
        width: "100%",
      }}
    >
      <Container maxWidth={"lg"}>
        <div></div>
      </Container>
    </div>
  );
};

export default SeeBooking;
